def transform(sequence):
    count = 0
    transformed_seq = ""

    for num in sequence:
        if num == '0':
            transformed_seq = transformed_seq[:count] + '0' + transformed_seq[count:]
        else:
            transformed_seq += num
        count += 1

    return transformed_seq
def transform(sequence):
    zero_count = sequence.count('0')
    return '0' * zero_count + sequence.replace('0', '')
